pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

contract Prontuario {
       struct Prontuario {
        string name;
        string cpf;
        string nome_social;
        string dt_nasc;
        string sexo;
        string cor_raca; 
        string nome_da_mae;
        string nome_do_pai;
        string nacionalidade;
        string municipio;
        string rg;
        string telefone; 
        string email;
        string pais;
        string cep; 
        string estado; 
        string bairro; 
        string logradouro;
        string numero; 
        string complemento;
        string referencia;
        string area;
        string microarea;
        string estado_civil;
        string NIS_PIS_PASEP;
        string n_prontuario;
        string ocupacao; 
        string escolaridade;
        string tipo_sanguineo; 
        string orientacao_sexual;
        string identidade_de_genero;
    }
}
